import Child3 from "./Child3";

const Parent3 = () => {
    const [name, setName] = useState('')

const changeHandler = (name) => {
  setName(name.target.value)
}

    return (
        <div>
            <h1>Parent component</h1>
            <form>
                <input type={'text'}
                placeholder={'Enter something...'}
                onChange={changeHandler}
               />
            </form>
        <Child3 name={name}/>
        </div>
    );
};

export default Parent3;
